1.2.1.1. 说明
一个方便C#和WPF开发的包。

简单的CacheHelper，无需任何其他扩展。
许多常用的Converters，用于WPF。
许多String、Int、Double、Float、List、Dictionary等的扩展方法，用于转换。
集成反射和Linq，方便使用。
提供了一些常用的WPF用户控件，如HighlightTextBlock、PlaceholderTextBoxControl、CustomToolTip。
提供了Messenger、Navigation、Command、ViewModelBase、Auto Validation等WPF MVVM模式的功能。
提供了一些WPF的对话框扩展，如MessageBox、OpenFileDialog、SaveFileDialog、CustomInputDialog。
一些未来SDK的预览功能，如record、CallerArgumentExpression、RequiredMember。
