1.2.1.2.2. Command
对于WPF，你可以使用ActionCommand轻松地将命令绑定到按钮。
private string name;
public string Name
{
    get => name;
    set
    {
        OnPropertyChanging(name, value);
UpdateSyncCommand = new ActionCommand(
    () =>
    {
        Thread.Sleep(1000);
        this.Name = "James Harden";
    },
    () => true
);

或者，你可以使用AsyncCommand轻松地将异步命令绑定到按钮。
private string name;
public string Name
{
    get => name;
    set
    {
        OnPropertyChanging(name, value);
        name = value;
        OnPropertyChanged(name, value);
    }
}
public IAsyncCommand UpdateAsyncCommand { get; private set; }
UpdateAsyncCommand = new AsyncCommand(
    async () =>
    {
        await Task.Delay(1000);
        this.Name = "Clay Tomposon";
    },
    () => true
);

此外，你还可以使用NavigateWithParameterCommand轻松地将导航命令绑定到按钮。
internal class StudentsViewModel : SharpBoxes.WPFHelpers.ViewModelBase
{
    //...
