1.2.1.2.13. CSV模块化集成

[模块介绍]
CsvDataBase所有模块的基类，意味着你可以自己自定义实现
CsvDataBlank代表添加空行
CsvDataCustom代表自定义数据，支持输入string[]和string,如果字符串中包含逗号，则会被分割成多条数据；如果不包含逗号，则会被当作一条数据。
CsvDataNormal代表常规数据，支持输入类型实例或List实例，会自动反射得到所有属性，并可以通过DisplayName自定义列名



//模拟数据
var datas1 = ClassInfo.FakeMany(2);
var datas2 = Student.FakeMany(10);
//创建CSV文件并添加数据
CsvOprHelper
    .ToCSV(
        new List()
        {
            new CsvDataNormal(datas1),
            new CsvDataBlank(),
            new CsvDataBlank(),
            new CsvDataBlank(),
            new CsvDataNormal(datas2),
            new CsvDataBlank(),
        }
    )
    .SaveToFile(@"C:\Users\zheng\Desktop\工作簿1.xlsx");
//在已有的CSV文件中添加数据
CsvOprHelper.AppendDataToFile(
    new List()
    {
        new CsvDataCustom("a", "b", "c"),
        new CsvDataBlank(),
        new CsvDataCustom(new[] { "e", "f", "g" }),
        new CsvDataBlank(),
        new CsvDataCustom("h,i,j"),
        new CsvDataNormal(datas1),
        new CsvDataBlank(),
        new CsvDataNormal(datas2),
        new CsvDataBlank(),
    },
    @"C:\Users\zheng\Desktop\工作簿1.xlsx"
);

更方便的写法
CsvOprHelper.AppendDataToFile(
    new CsvDataCustom("a", "b", "c")
        .AddBlank()
        .AddCustom([ "e", "f", "g" ])
        .AddBlank()
        .AddCustom("h,i,j")
        .AddNormal(datas1)
        .AddBlank()
        .AddNormal(datas2)
        .ToList(),
    @"C:\Users\zheng\Desktop\工作簿1.xlsx"
);

